import { useNavigate, Link } from "react-router-dom";

function HomePage() {

    const navigate = useNavigate();

    function navigateHandler() {
        navigate("/products");
    }
    return <>
        <h1>Home Page</h1>
        <p>
            Go to <Link to="products">the list of products.</Link>
        </p>
        <p>
            <button onClick={navigateHandler}>
                Navigate
            </button>
        </p>
    </>
}
export default HomePage;
